      const [ recipes, setRecipes ] = useState([]);
      const [ editData, setEditDate ] = useState({});
    //   const [ userState, setUserState ] = useState({});
      const navigate = useNavigate();

      useEffect(() => {
        getAll()
        .then(result => {
          setRecipes(result)
        })
      }, []);


